problem_content_answer_ess_02:
Möjlig orsak 
 1. Solcellssträngen kortsluter skyddsjorden; 
 2. Installationsmiljön för solcellssträngar är relativt fuktig; 
 3. Batteriporten är kortsluten till skyddsjorden; 
 Så här hanterar du 
 1. Starta om enheten. Om felet försvinner kan du fortsätta använda den; 
 2. Om felet uppstår eller inte försvinner flera gånger i rad, vänligen kontakta tjänsteleverantören;

problem_content_answer_ess_03:
