problem_content_answer_ess_07:
Möjlig orsak 
 Dålig kontakt i mätarens kommunikationsledning; 

 Så här åtgärdar du 
 1. Kontrollera om det finns glapp i båda ändar av kommunikationsledningen; 
 2. Om ledningarna är normala och felet alltid har funnits, kontakta tjänsteleverantören;

problem_content_answer_ess_08:
