 Trefasutrustning, dieselgeneratorspänningen saknar en eller två faser; 

 Hur man hanterar 
 Kontakta tjänsteleverantören;

problem_content_answer_ess_09:
Möjlig orsak 
 Dieselgeneratorns fasföljd är onormal; 

 Så här hanterar du problemet 
 Kontakta tjänsteleverantören;

problem_content_answer_ess_10:
Möjlig orsak 
 Grid och Backup är omvända; 

 Hur man hanterar 
 När strömmen är avstängd, justera grid- och backup-terminalerna;

problem_content_answer_ess_11:
Möjlig orsak 
 På kort tid har utrustningen drabbats av flera allvarliga fel i rad; 

 Så här hanterar du problemet 
 Kontakta tjänsteleverantören för att låsa upp den;

problem_content_answer_ess_12:
Möjlig orsak 
 Batterimodulen är bortkopplad från PCS:en; 

 Så här hanterar du problemet 
 1. Kontrollera att batteriet är anslutet till PCS:en. Om det inte är det, anslut det efter att du har stängt av strömmen; 
 2. Kontrollera om batterimodulen är felaktig. Om det är ett fel, kontakta tjänsteleverantören för att åtgärda det.

problem_content_answer_ess_15:
Möjlig orsak 
 Läckagedetekteringskretsen är onormal; 

 Så här åtgärdar du 
 1. Starta om enheten och kontrollera om felet är åtgärdat; 
 2. Om det inträffar ofta eller inte kan åtgärdas under en längre tid, vänligen kontakta tjänsteleverantören;

problem_content_answer_ess_16:
Möjlig orsak 
 Enhetens interna kommunikation är onormal; 

 Så här hanterar du 
 1. Starta om enheten och kontrollera om felet är åtgärdat; 
 2. Om felet uppstår flera gånger i rad eller inte försvinner, kontakta tjänsteleverantören;

problem_content_answer_ess_17:
Möjlig orsak 
 Det finns ett fel inuti batterimodulen; 

 Så här åtgärdar du 
 1. Starta om batterimodulen, felet försvinner och du kan fortsätta använda den; 
 2. Om omstarten fortfarande misslyckas eller om felet uppstår ofta, vänligen kontakta tjänsteleverantören;

